import React from 'react';
import '../../styles/index.css';

export default () => {
  return (
    <div>
      <h1 className="homePageTitle"> About US PAGE </h1>
      <img src="/img/030.png" alt="About Us" className="aboutus-img" />
      <p>
      Welcome to OPEN EYES, where innovation meets expertise in web development. At OPEN EYES, we are passionate about transforming ideas into dynamic, user-friendly digital solutions. Our team of skilled developers and designers is dedicated to crafting websites and applications that not only meet but exceed our clients’ expectations.

With years of experience and a commitment to staying at the forefront of technology trends, we offer a comprehensive range of services including custom web development, responsive design, and digital strategy consulting. Our collaborative approach ensures that we understand your unique needs and deliver tailored solutions that drive success.

At OPEN EYES, we believe in the power of technology to create meaningful connections and solve complex challenges. Whether you’re a startup looking to establish your online presence or an established business seeking to enhance your digital footprint, we are here to guide you every step of the way.

Join us on a journey to bring your vision to life and make a lasting impact in the digital world.
      </p>
    </div>
  )
}
